import React from 'react';
import Home from './page/Home';
import ThreeTuto2 from './three/ThreeTuto2';
// import Tutorial1 from "./canvas/Tutorial1";

import { BrowserRouter } from 'react-router-dom';

function App() {
  return (
    <>
      <BrowserRouter>
